import style from './Header.module.css'

const Header = () => {
	return (
		<div className={style.header}>
			<div className={style.logo}>
				<div className="icon">icon</div>
				<div className="chatName"></div>
			</div>
			<div className={style.navbar}>navbar</div>
		</div>
	)
}

export default Header
